// export default Gallery
import React from 'react';
import studentGallery from '../photos/laba.jpg';

const Gallery = () => {
  return (
    <div className='relative mt-[10px]'>
      {/* Image Container */}
      <div className="relative w-full h-[449px]">
        {/* Image with dull effect */}
        <img src={studentGallery} alt="Custom Icon" className="w-full h-full opacity-500" />
        {/* Text overlay */}
        <div className="absolute inset-0 flex items-center justify-center text-white text-lg font-bold">
        Our events gallery
        <p>
        Events at DBTR are filled with joyous occasions, cultural gatherings, and learning opportunities that bring us all together.
        </p>
        </div>
      </div>
    </div>
  );
};

export default Gallery;
